import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import Popper from "@mui/material/Popper";
import Fade from "@mui/material/Fade";
import Paper from "@mui/material/Paper";

function Navbar() {
  let navigate = useNavigate();
  const [anchorEl, setAnchorEl] = useState(null);
  const [open, setOpen] = useState(false);
  const [placement, setPlacement] = React.useState();
  const userEmail = sessionStorage.getItem("userEmail");
  const userFirstName = sessionStorage.getItem("userFirstName");
  const userLastName = sessionStorage.getItem("userLastName");

  function logoutClick() {
    sessionStorage.clear();
    navigate("/login");
  }

  const handleClick = (newPlacement) => (event) => {
    setAnchorEl(event.currentTarget);
    setOpen((prev) => placement !== newPlacement || !prev);
    setPlacement(newPlacement);
  };

  return (
    <>
      <nav className="navbar navbar-expand-lg navbar-light bg-light ">
        <div className="container-fluid">
          <svg
            xmlns="http://www.w3.org/2000/svg"
            width="30"
            height="30"
            fill="currentColor"
            class="bi bi-list"
            viewBox="0 0 1 16"
            color="black"
          >
            <path
              fill-rule="evenodd"
              d="M2.5 12a.5.5 0 0 1 .5-.5h10a.5.5 0 0 1 0 1H3a.5.5 0 0 1-.5-.5m0-4a.5.5 0 0 1 .5-.5h10a.5.5 0 0 1 0 1H3a.5.5 0 0 1-.5-.5m0-4a.5.5 0 0 1 .5-.5h10a.5.5 0 0 1 0 1H3a.5.5 0 0 1-.5-.5"
            />
          </svg>
          <img
                src="https://upload.wikimedia.org/wikipedia/commons/thumb/7/7e/Gmail_icon_%282020%29.svg/800px-Gmail_icon_%282020%29.svg.png"
                width="30"
                height="30"
                alt="gmail"
              />
           
          <span
            className="navbar-brand text-primary"
            style={{ fontFamily: "Arial", letterSpacing: "3px" }}
          >
            GMAIL SERVICE
          </span>

          {/* <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarSupportedContent"
            aria-controls="navbarSupportedContent"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button> */}
          <div className="row d-flex justify-content-end">
            <div className="col ">
              <i
                className="fs-4 fa-regular fa-circle-question icon"
                title="Support"
              ></i>
            </div>
            <div className="col">
              <i className="fs-4 fa-solid fa-gear icon" title="Settings"></i>
            </div>
            <div className="col">
              <i
                className="fs-4 fa-regular fa-circle-user icon"
                title="Profile"
                onClick={handleClick("bottom-end")}
              ></i>
            </div>

            <Popper
              open={open}
              anchorEl={anchorEl}
              placement={placement}
              transition
            >
              {({ TransitionProps }) => (
                <Fade {...TransitionProps} timeout={350}>
                  <Paper>
                    <div className="d-flex ">
                      <div className="mt-4 ms-3">
                        <i className="fs-3 fa-regular fa-circle-user icon"></i>
                      </div>
                      <div className="mt-2 ms-2 me-3">
                        <span>{userFirstName} </span>
                        <span>{userLastName}</span> <br />
                        <span>{userEmail}</span>
                      </div>
                    </div>
                    <div className="mt-3 text-center pb-3">
                      <button
                        className="btn btn-outline-warning"
                        onClick={() => {
                          logoutClick();
                        }}
                      >
                        Logout
                      </button>
                    </div>
                  </Paper>
                </Fade>
              )}
            </Popper>
          </div>
        </div>
      </nav>
    </>
  );
}

export default Navbar;
